import { ADDTODO } from '../actions'

const initialState = {
    todo: ['adsf']
}

export default (state = initialState, action) => {
    switch (action.type) {
        case ADDTODO:
            state.todo.push('state')
            console.log(state)
            return state.todo
        default:
            return state
    }
}
